import java.util.*
import kotlin.math.min

fun main() {
    val children = Array(11000) { mutableMapOf<Int, Int>() }
    val parent = IntArray(11000)
    val nodes = mutableListOf(1)
    var id = 5001
    var k = 1
    var j = 1
    fun recur(node: Int) {
        while (DATA[j] != ')') {
            var l = 0
            while (DATA[j].isDigit()) {
                l *= 10
                l += DATA[j] - '0'
                j++
            }
            if (DATA[j] == '(') {
                j++
                id++
                parent[id] = node
                children[node][id] = l
                nodes.add(id)
                recur(id)
            } else {
                j++
                k++
                parent[k] = node
                children[node][k] = l
                nodes.add(k)
            }
        }
        j++
    }
    recur(1)
    val n = readLine()!!.toInt()
    val subtree = IntArray(12001)
    val tokenizer = StringTokenizer(readLine()!!)
    for (j in 1..n) {
        val k = tokenizer.nextToken().toInt()
        subtree[k]++
    }
    for (k in nodes.reversed()) {
        subtree[parent[k]] += subtree[k]
    }
    var curr = 0L
    for (k in nodes) {
        if (parent[k] != 0) {
            curr += subtree[k].toLong() * children[parent[k]][k]!!.toLong()
        }
    }
    var answer = curr
    val stack = Stack<Int>()
    for (child in children[1].keys) {
        stack.push(child)
    }
    while (!stack.isEmpty()) {
        var k = stack.pop()
        if (k > 0) {
            stack.push(-k)
            val l = children[parent[k]][k]!!.toLong()
            curr -= subtree[k].toLong() * l
            curr += (n - subtree[k]).toLong() * l
            answer = min(answer, curr)
            for (child in children[k].keys) {
                stack.push(child)
            }
        } else {
            k = -k
            val l = children[parent[k]][k]!!.toLong()
            curr += subtree[k].toLong() * l
            curr -= (n - subtree[k]).toLong() * l
        }
    }
    println(answer)
}

